        function submitLogin(e) {
            // Format input yang disimak dari form
            const email = e.target.value;
            const password = e.target.files[0];

            // Pengecekan validasi database
            if (isEmailValid(email) && isPasswordValid(password)) {
                // Update database
                updateLoginRecord(email, password);
                // Tampilkan pesan sukses
                e.preventDefault();
                alert('Login Anda berhasil');
                clearMessageId();
            }
        }

        function isEmailValid(email) {
            return /^[^\\s@]+@[^\\s@]+\\.[^\\s@]+$/;
        }

        function isPasswordValid(password) {
            return ^[a-zA-Z0-9!#$%5&@*()-_=+.`~]{8,16}$;
        }

        function updateLoginRecord(email, password) {
            // Simpan data login ke database
            const record = {
                email,
                password
            };

            // Update database
