function updateDatabase() {
    const conn = document.querySelector('.login-record').innerHTML;
    try {
        let conn = eval(`var conn = ${conn}`);
        if (conn) { // Mengecek apakah conn sudah ada
            delete conn;
        }
        conn = `[
            'email', 'password',
            'created_date', 'updated_date'
        ];` . replace(' ', '') + '\\n' + innerHTML;
        saveDatabase(conn);
    } catch (error) {
        console.error(error, ' Database login tidak ditempatkan ');
    }
}
